sys_variable_value.value:
(function execute(inputs, outputs) {

  var parmObj = {};
  parmObj['status'] = inputs['status'];
  parmObj['request_id'] = inputs['request_id'];
  parmObj['req_reviewer_id'] = inputs['req_reviewer_id'];



  var parmStr = JSON.stringify(parmObj);

  gs.eventQueue('x_1027446_case_m_0.notification_event',null,inputs['email_id'],parmStr);


})(inputs, outputs);

